  index.html: |
    <!DOCTYPE html>
    <html><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
            <title>Porsche HYDRA Data Platform</title>
            <link rel="shortcut icon" href="/favicon.ico">
            <meta name="mobile-web-app-capable" content="yes">
            <meta name="theme-color" content="#fff">
            <link rel="stylesheet" type="text/css" href="/style.css">
            <script type="application/javascript">
                    function dynamicChangesOnLoad() {
                            // Change the background photo depending on the month
                            curr_mon = new Date().getMonth()
                            if (curr_mon > 3 && curr_mon < 10) {
                                    document.getElementById("chooser").className = "summer"
                            }
                            else {
                                    document.getElementById("chooser").className = "winter"
                            }
                    }
            </script>
    </head>
    <body id="chooser" onload="dynamicChangesOnLoad()">
            <div class="logo"><a href="https://www.porsche.com/" target="_blank"><img src="porsche-svg.svg" title="" alt="" style="height:70px;"></a></div>
            <div class="login">
                    <div id="general">
                            <b id="hydra-app-name">Porsche HYDRA</b>
                            <span class="description">
                                    <p><strong>Welcome to HYDRA Data Platform!</strong></p>
                            </span>
                    </div>
            </div>
    </body>
    </html>
  style.css: |
    @media screen and (max-height: 600px){
      #chooser {
    	position: absolute !important;
      }
      
      .main, .login {
    	width: 890px;
    	height: 850px;	
    	position: relative !important;
    	top: 15%;
    	/*transform: translateY(20%) !important;*/
    	}
    	
    	footer {
    		position: fixed !important;
    	}
    }
    
    #chooser {
    	font-family: "Source Sans Pro", Helvetica, sans-serif;
    }
    
    #chooser.summer {
    	background: url("background_summer.jpg") no-repeat left 80% fixed; 
    	-webkit-background-size: cover;
    	-moz-background-size: cover;
    	-o-background-size: cover;
    }
    
    #chooser.winter {
    	background: url("background_winter.jpg") no-repeat left 80% fixed; 
    	-webkit-background-size: cover;
    	-moz-background-size: cover;
    	-o-background-size: cover;
    }
    
    #chooser.error {
    	background: url("background_summer.jpg") no-repeat left 80% fixed; 
    	-webkit-background-size: cover;
    	-moz-background-size: cover;
    	-o-background-size: cover;
    }
    
    .logo
    	{
    	position: absolute;
    	right: 5%;
    	top: 5%;
    	}
    
    .main, .login {
    	width: 890px;
    	height: 850px;	
    	position: absolute;
    	top: 15%;
    	/*transform: translateY(-50%);*/
    }
    .menu
    	{
    	position: relative;
    	color: #3c3b3b;
    	margin: 20px;		
    	display: flex;		
    	}
    #applications {
    	width: 600px;
    	margin-right: 20px;
    	background-color: rgba(255, 255, 255, 1);
    	box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.5), 0 6px 20px 0 rgba(0, 0, 0, 0.5);
    	padding: 20px;
    }
    
    .menuheadline
    	{
    	font-weight: 700;
    	color: rgb(21, 23, 24);
    	font-size: 25px;
    	margin-top: 20px;
    	margin-bottom: 10px;
    	display: inline;
    	}
    .description-text .menuheadline {
    	margin-bottom: 3px;
    }
    .icon {
    	width: 100px;
    }
    #general {
    	position: relative;
    	padding: 20px;
    	display: grid;
    	margin: 20px;	
    	color: #3c3b3b;
    	background-color: rgba(255, 255, 255, 0.8);
    	box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.5), 0 6px 20px 0 rgba(0, 0, 0, 0.5);
    	font-size: 15px;
    }
    #general b {
    	margin-bottom: 10px;
    	font-size: 30px;
    	display: block;
    }
    .description a {
    	color: rgb(213, 0, 28);
    }
    .login1 , .login2, .support-box  {
    	position: relative;
    	color: #3c3b3b;
    	margin: 20px;
    	display:flex;		
    	background-color: rgba(255, 255, 255, 0.8);	
    	box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.5), 0 6px 20px 0 rgba(0, 0, 0, 0.5);
            }
    .description-text *{
    	display: inline-block;
    }
    .description-text b{
    	display: inline;
    }
    .description-text {
    	color: rgb(21, 23, 24);
    	margin-right: 50px;
    	text-align: justify;
    	font-size: 15px;
    }
    .description {
    	display: inline;
    }
    .description-area {
    	width: 490px;
    	height: 200px;
    	margin-right: -1px;
    	padding-left: 20px !important;
    	background-color: #fff;
    	z-index: 50;
    }
    .button-area, .description-area {
    	display: flex;	
    	color: #3c3b3b;
    }
    .button-area {
    	display: block;
    	position: absolute;
    	right: 20px;
    	width: 180px;
    	top: 50%;
    	transform: translateY(-50%);
    }
    .arrow-area {
    	display: inline-block;
    width: 200px;
    overflow: hidden;
    transform: rotate(270deg);
    -transform: rotate(270deg);
    }
    .arrow-area:after {
     content: "";
    position: absolute;
    width: 141.42px;
    height: 141.42px;
    background: #fff;
    transform: rotate(45deg);
    top: -69.71px;
    left: 29.29px;
    box-shadow: -1px -1px 10px -2px rgba(0, 0, 0, 0.5);
    }
    #login-button-vw {
    	right: 22px;
    }
    #login-button-ppn {
    	right: 9px;
    }
    .p-icon-doc {	
    	font: 400 16px Arial;
    	width: 160px;
    	line-height: 1.75;
    	border: 1px solid #3c3b3b;
    	background-color: rgba(255, 255, 255, 0);
    	color: #3c3b3b;
    	padding: 16px;
    	margin: 16px;
    	margin-right: 30px;
    	margin-top: 8px;
    }
    .p-icon-doc:hover, .p-icon-support:hover {
    	background-color: rgb(21, 23, 24);
    	border: 1px solid rgb(21, 23, 24);
    	color: #fff;
    	cursor: pointer
    }
    .p-icon-doc:focus, .p-icon-support:focus {
    	background-color: rgb(21, 23, 24);
    	border: 1px solid rgb(21, 23, 24);
    	outline: none !important;
    	color:#fff;
    }
    .p-icon-login
    	{
    	font: 400 16px Arial;
    	width: 160px;
    	line-height: 1.75;
    	border: 1px solid rgb(213, 0, 28);
    	background-color:rgb(213, 0, 28);
    	color: #fff;
    	padding: 16px;
    	margin: 6px;
    	margin-right: 30px;	
    	margin-bottom: 8px;
    	}
    
    .p-icon-support
    	{
    	font: 400 16px Arial;
    	width: 160px;
    	line-height: 1.75;
    	border: 1px solid #3c3b3b;
    	background-color: #ccc;
    	color: #3c3b3b;
    	padding: 5px 16px;
    	margin: 6px;
    	margin-right: 30px;	
    	margin-bottom: 8px;
    	}
    
    .p-icon-login:hover {
    	background-color: rgb(152, 0, 20);
    	border: 1px solid rgb(152, 0, 20);
    	cursor: pointer;
    }
    .p-icon-login:focus {
    	background-color: rgb(152, 0, 20);
    	border: 1px solid rgb(152, 0, 20);
    	outline: none !important;
    }
    .nav-arrow {
    	height:16px;
    	width: 16px;
    	position: absolute;
    	top: 2.5px;
    }
    #chooser ul
    	{
    	list-style: none;
    	padding-left: 10px;
    	padding-top: 0px;
    	margin-bottom: 0px;
    	}
    
    ul li
    	{
    	position: relative;
    	margin-left: 0px;
    	padding-left: 0px;
    	padding-bottom: 5px;
    	}
    
    ul li a
    	{
    	color: #3c3b3b;
    	transition: color 0.2s ease;
    	font-weight: 400;
    	text-decoration: none;
    	font-size: 15px;
    	line-height: 1.75;
    	-moz-transition: color 0.2s ease;
    	-webkit-transition: color 0.2s ease;
    	-moz-osx-font-smoothing: grayscale;
    	-webkit-font-smoothing: antialiased;
    	}
    ul li a span {
    	margin-left: 25px;
    }
    ul li a:hover .nav-arrow 
    	{
    	fill:rgb(213, 0, 28);
    	}
    ul li a:hover, footer a:hover {
    	color: rgb(213, 0, 28) !important;
    }
    
    #support {
    	color: rgb(213, 0, 28);
    }
    
    footer {
    	position: absolute;
    	text-align: right;
    	bottom: 0px;
    	padding: 10px;
    	padding-right: 20px;
    	margin-left: 20px;
    	margin-right: 20px;
    	background-color: rgba(255, 255, 255, 0.45);
    	width: calc(100% - 86px);
    }
    
    footer a {
    	color: #3c3b3b;
    	margin-left: 20px;
    	margin-right: 20px;
    	text-decoration: none;
    	font-weight: 500;
    }
    
    .imprint {
    	text-align: justify;
    	text-justify: default;
    }
    
    #privacy, #legal
    	{
    	font-family: "Source Sans Pro", Helvetica, sans-serif;
    	padding: 20px;
    	padding-top: 130px;
    	}
    	
    #privacy a, #legal a {
    	color: rgb(213, 0, 28);
    }
    
    ul.imprint {
    	list-style-type: square;
    }
